import style from './CatalogPage.module.css';
import Header from '../../components/Header/Header';
import Product from '../../components/Product/Product';

const CatalogPage = () => {
    return ( <
        div className = {
            style['catalog-page']
        } >
        <
        Header / >
        <
        Product / >
        <
        Cart / >
        <
        /div>
    );
};

export default CatalogPage;
